import React from 'react';
import "./styles.scss";

export class DateInput extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            start: props.startDate,
            end: props.endDate
        }
    }
    startChange = (e) => {
        this.setState({
            start: e.target.value
        })
    }
    endChange = (e) => {
        this.setState({
            end: e.target.value
        })
    }
    render = () => {

        return (
            <form className="dateInput">
                <input type="date" className="startDate" value="min" onChange={this.startChange} />
                <input type="date" className="endDate" value="today" onChange={this.endChange}/>
            </form>
        );
    }
}
